--
-- Table structure for table `tz_inventory`
--

DROP TABLE IF EXISTS `tz_inventory`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tz_inventory` (
  `id` varchar(45) NOT NULL,
  `tenant_id` varchar(45) NOT NULL,
  `location_id` varchar(45) NOT NULL,
  `invoice_line_id` varchar(45) DEFAULT NULL,
  `package_id` varchar(45) NOT NULL,
  `product_id` varchar(45) NOT NULL,
  `last_inventory_id` varchar(45) DEFAULT NULL,
  `last_location_id` varchar(45) DEFAULT NULL,
  `last_reconciliation_id` varchar(45) DEFAULT NULL,
  `change_quantity` decimal(16,6) NOT NULL,
  `available_units` decimal(16,6) NOT NULL COMMENT '\nNumber of units in the batch. ',
  `reserved_units` decimal(16,6) NOT NULL,
  `packed_and_ready_units` decimal(16,6) NOT NULL,
  `sold_units` decimal(16,6) NOT NULL,
  `decision_pending_units` decimal(16,6) NOT NULL,
  `returned_units` decimal(16,6) NOT NULL,
  `destroyed_units` decimal(16,6) NOT NULL,
  `adjusted_units` decimal(16,6) NOT NULL,
  `converted_units` decimal(16,6) NOT NULL DEFAULT '0.000000',
  `unit_of_measurement` varchar(45) DEFAULT NULL,
  `type` varchar(255) NOT NULL,
  `batch_id` varchar(45) NOT NULL,
  `external_id` varchar(100) DEFAULT NULL,
  `cost_per_unit` decimal(16,6) NOT NULL,
  `excise_tax_per_unit` decimal(16,6) NOT NULL,
  `status` varchar(255) DEFAULT NULL COMMENT '\nInventory Status - for example, sold, reserved, returned, loss etc. ',
  `last_count_date` datetime DEFAULT NULL,
  `last_user_id` varchar(45) NOT NULL,
  `source` varchar(45) NOT NULL,
  `last_action` varchar(255) NOT NULL,
  `last_ticketline_id` varchar(45) DEFAULT NULL,
  `returned_from_pos` decimal(16,6) NOT NULL,
  `prev_id` varchar(45) DEFAULT NULL,
  `start_date` datetime NOT NULL,
  `end_date` datetime DEFAULT NULL,
  `current_flag` tinyint(4) NOT NULL DEFAULT '1',
  `version` int(11) NOT NULL,
  `original_start_date` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `inventory_location_fk_idx` (`location_id`),
  KEY `inventory_ref_id_idx` (`tenant_id`,`current_flag`),
  KEY `inventory_available_units` (`available_units`,`invoice_line_id`,`tenant_id`,`current_flag`),
  KEY `inventory_product` (`product_id`,`tenant_id`,`current_flag`),
  KEY `inventory_invoice_line` (`invoice_line_id`,`tenant_id`,`current_flag`),
  KEY `inventory_package_fk_idx` (`package_id`),
  KEY `inventory_product_available_status` (`product_id`,`current_flag`,`available_units`,`tenant_id`,`status`),
  CONSTRAINT `inventory_invoice_line_fk` FOREIGN KEY (`invoice_line_id`) REFERENCES `tz_invoice_line` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `inventory_location_fk` FOREIGN KEY (`location_id`) REFERENCES `tz_location` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `inventory_package_fk` FOREIGN KEY (`package_id`) REFERENCES `tz_package` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `inventory_product_fk` FOREIGN KEY (`product_id`) REFERENCES `tz_product` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `inventory_tenant_fk` FOREIGN KEY (`tenant_id`) REFERENCES `tz_tenant` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

