DROP TABLE IF EXISTS `tz_invoice`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tz_invoice` (
  `id` varchar(45) NOT NULL,
  `tenant_id` varchar(45) NOT NULL,
  `distributor_id` varchar(45) DEFAULT NULL,
  `location_id` varchar(45) DEFAULT NULL,
  `invoice_cost_id` varchar(45) NOT NULL,
  `visible_id` int(11) NOT NULL,
  `external_visible_id` varchar(255) DEFAULT NULL,
  `manifest_number` varchar(255) DEFAULT NULL,
  `status` varchar(255) NOT NULL,
  `inventory_type` varchar(45) NOT NULL,
  `dispensary_license` varchar(45) DEFAULT NULL,
  `excise_tax_included` tinyint(4) NOT NULL,
  `last_user_id` varchar(255) NOT NULL,
  `term_id` varchar(45) DEFAULT NULL COMMENT 'Points to tz_dropdown with name PAYMENT_TERM',
  `accepted_date` datetime DEFAULT NULL,
  `due_date` datetime DEFAULT NULL COMMENT '\nPayment due date',
  `departure_date` datetime DEFAULT NULL,
  `arrival_date` datetime DEFAULT NULL,
