--
-- Table structure for table `tz_price_flat`
--

DROP TABLE IF EXISTS `tz_price_flat`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tz_price_flat` (
  `id` varchar(45) NOT NULL,
  `tenant_id` varchar(45) NOT NULL,
  `product_id` varchar(45) NOT NULL,
  `price` decimal(16,6) NOT NULL COMMENT '\nList price excluding discounts',
  `customer` varchar(255) DEFAULT NULL COMMENT 'BLANK - Default\nCustomer Group Pricing is applied to',
  `unit` varchar(45) DEFAULT NULL COMMENT 'EACH - basic pricing\nGRAM - per gram pricing',
  `prev_id` varchar(45) DEFAULT NULL,
  `start_date` datetime NOT NULL COMMENT '	',
  `end_date` datetime DEFAULT NULL,
  `current_flag` tinyint(4) NOT NULL DEFAULT '1',
  `version` int(11) NOT NULL,
  `original_start_date` datetime NOT NULL,
  `last_user_id` varchar(45) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `product_price_location_idx` (`tenant_id`),
  KEY `tz_price_flat_product_reference_idx` (`product_id`),
  KEY `ref_id` (`tenant_id`,`current_flag`),
  KEY `price_flat_product` (`product_id`,`tenant_id`,`current_flag`),
  CONSTRAINT `tz_price_flat_product_reference` FOREIGN KEY (`product_id`) REFERENCES `tz_product` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tz_price_flat_tenant_reference` FOREIGN KEY (`tenant_id`) REFERENCES `tz_tenant` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Flat pricing ';
/*!40101 SET character_set_client = @saved_cs_client */;

