DROP TABLE IF EXISTS `tz_price_threshold`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tz_price_threshold` (
  `id` varchar(45) NOT NULL,
  `tenant_id` varchar(45) NOT NULL,
  `tier_id` varchar(45) NOT NULL,
  `price_per` decimal(16,6) NOT NULL COMMENT 'List price excluding discounts',
  `customer` varchar(255) DEFAULT NULL COMMENT 'BLANK - Default\nCustomer Group Pricing is applied to',
  `quantity_start` decimal(16,6) NOT NULL,
  `quantity_end` decimal(16,6) DEFAULT NULL,
  `tolerance` decimal(16,6) NOT NULL DEFAULT '0.000000',
  `prev_id` varchar(45) DEFAULT NULL,
  `start_date` datetime NOT NULL,
  `end_date` datetime DEFAULT NULL,
  `current_flag` tinyint(4) NOT NULL DEFAULT '1',
  `version` int(11) NOT NULL,
  `original_start_date` datetime NOT NULL,
  `last_user_id` varchar(45) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `product_price_location_idx` (`tenant_id`),
  KEY `tz_price_tier_threshold_reference_idx` (`tier_id`),
  KEY `threshold_current` (`current_flag`),
  KEY `ref_id` (`current_flag`),
  CONSTRAINT `tz_price_threshold_tenant_reference` FOREIGN KEY (`tenant_id`) REFERENCES `tz_tenant` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tz_price_tier_threshold_reference` FOREIGN KEY (`tier_id`) REFERENCES `tz_price_tier` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Threshold based Pricing';
