CREATE DEFINER=`root`@`localhost` PROCEDURE `generateBarcodes`()
proc:begin
	
	select @count := count(*) from `tz_invoice_line` il
	LEFT JOIN tz_barcode bc ON il.id = bc.reference_id
    and bc.reference_type = 'invoiceline'
    where bc.id IS NULL and
    il.tenant_id = '1e43a152-f84f-4022-a2c6-0c66c86e9e70';

    set @counter = 0;
    set @max_repeat = 50;

    
    while @count > 0 and @counter < @max_repeat do

    drop temporary table if exists temp;
	create temporary table if not exists temp (
		`id` varchar(255),
		`invoice_line_id` varchar(255),
		`code` varchar(3),
		`start_date` datetime,
		INDEX code_index (code)
	);

	
	INSERT INTO `temp`
	(`id`, `invoice_line_id`, `code`, `start_date`)
	select
	uuid(),
	il.id,
	lpad(conv(floor(rand()*pow(36,8)), 10, 36), 3, 0) as code,
	il.original_start_date
	from `tz_invoice_line` il
	LEFT JOIN
		tz_barcode bc ON il.id = bc.reference_id
		AND bc.reference_type = 'invoiceline'
	WHERE
		bc.id IS NULL and
		il.tenant_id = '1e43a152-f84f-4022-a2c6-0c66c86e9e70';

	drop temporary table if exists temp2;
	create temporary table if not exists temp2 as (
	select * from temp
	group by code
	having count(*) > 1);

	
	delete from temp
	where code in (select code from temp2);

	
	delete from temp
	where code in (select effective_code from tz_barcode where tenant_id = '1e43a152-f84f-4022-a2c6-0c66c86e9e70');

    
	INSERT INTO `tz_barcode` (`id`, `tenant_id`, `reference_type`, `reference_id`, `code`, `size`, `source`, `ref_id`, `start_date`, `current_flag`, `version`, `original_start_date`, `last_user_id`)
	SELECT temp.id, '1e43a152-f84f-4022-a2c6-0c66c86e9e70', 'invoiceline', temp.invoice_line_id, temp.code, '.5 x .5', 'TREEZ', temp.id, temp.start_date, 1, 1, temp.start_date, 'LIQUIBASE'
	FROM temp;

    
    select @count := count(*) from `tz_invoice_line` il
	LEFT JOIN tz_barcode bc ON il.id = bc.reference_id
    and bc.reference_type = 'invoiceline'
    where bc.id IS NULL and
		il.tenant_id = '1e43a152-f84f-4022-a2c6-0c66c86e9e70';

    set @counter = @counter + 1;

    end while;
end ;;
DELIMITER ;
