CREATE DEFINER=`root`@`localhost` PROCEDURE `report_customer_sp`(IN start_dtm_in datetime, IN end_dtm_in datetime, IN clear_period_in tinyint(1))
proc:
  begin
    declare rpt_name varchar(25) default 'report_customer_sp';

    select ifnull(max(last_run_dtm), '1971-01-01') into @last_run from custom_batch_job where report_name = rpt_name;

    if start_dtm_in is null
    then
      set @start_dtm = @last_run;
    else
      set @start_dtm = start_dtm_in;
    end if;

    if end_dtm_in is null
    then
      set @end_dtm := now();
    else
      set @end_dtm = end_dtm_in;
    end if;

    start transaction;

    if clear_period_in then
       delete from report_customer
           where last_updated_at >= @start_dtm
           and last_updated_at < @end_dtm;
    end if;

INSERT INTO `inventory`.`report_customer`
(`id`,
`first_name`,
`last_name`,
`nick_name`,
`phone`,
`email`,
`company`,
`customer_uuid`,
`customer_signup_date`,
`customer_cancel_date`,
`last_updated_at`,
`last_visit`,
`signup_flag`,
`gender`,
`age group`,
`age`,
`dob`,
`driver_license`,
`driver_license_expiration_date`,
`permit_expiration_date`,
`medical_id`,
`reward_balance`,
`customer_source`,
`groupnames`,
`visits`,
`notes`,
`opted_in`,
`patient_type`,
`customer_status`,
`violations`,
`netSales`,
`AvgSales`,
`street_1`,
`city`,
`state`,
`zipcode`,
`longitude`,
`latitude`,
`physician_first`,
`physician_last`,
`physician_phone`,
`physician_address`,
`physician_medical_id`,
`physician_email`,
`physician_notes`,
`caregiver`,
`report_last_updated`)
SELECT
    c.id,
    c.first_name,
    c.last_name,
    nick_name.detail_value AS nick_name,
    c.phone,
    c.email,
    c.company,
    c.customer_uuid,
    c.signup_date AS customer_signup_date,
    c.cancel_date AS customer_cancel_date,
    c.last_updated_at,
    last_visit.detail_value AS last_visit,
    c.signup_flag,
    IFNULL(gender.detail_value, 'U') AS gender,
    (CASE
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(LENGTH(dob.detail_value) >= 10
                                AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                                AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                            STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'N/A') = 'N/A')
        THEN
            'N/A'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(LENGTH(dob.detail_value) >= 10
                                AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                                AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                            STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'N/A') >= 60)
        THEN
            '60+'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(LENGTH(dob.detail_value) >= 10
                                AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                                AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                            STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'N/A') >= 50)
        THEN
            '50-59'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(LENGTH(dob.detail_value) >= 10
                                AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                                AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                            STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'N/A') >= 40)
        THEN
            '40-49'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(LENGTH(dob.detail_value) >= 10
                                AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                                AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                            STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'N/A') >= 30)
        THEN
            '30-39'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(LENGTH(dob.detail_value) >= 10
                                AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                                AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                            STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'N/A') >= 21)
        THEN
            '21-29'
        ELSE '0-20'
    END) AS `age group`,
    IFNULL(TIMESTAMPDIFF(YEAR,
                IF(LENGTH(dob.detail_value) >= 10
                        AND SUBSTRING(dob.detail_value, 5, 1) = '-'
                        AND SUBSTRING(dob.detail_value, 8, 1) = '-',
                    STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
                    NULL),
                CURDATE()),
            'N/A') AS age,
    IF(LENGTH(dob.detail_value) >= 10
            AND SUBSTRING(dob.detail_value, 5, 1) = '-'
            AND SUBSTRING(dob.detail_value, 8, 1) = '-',
        STR_TO_DATE(LEFT(dob.detail_value, 10), '%Y-%m-%d'),
        NULL) AS dob,
    drivers_license.detail_value AS drivers_license,
    IF(LENGTH(drivers_license_expiration_date.detail_value) >= 10
            AND SUBSTRING(drivers_license_expiration_date.detail_value,
            5,
            1) = '-'
            AND SUBSTRING(drivers_license_expiration_date.detail_value,
            8,
            1) = '-',
        STR_TO_DATE(LEFT(drivers_license_expiration_date.detail_value,
                    10),
                '%Y-%m-%d'),
        NULL) AS drivers_license_expiration_date,
    IF(LENGTH(permit_expiration_date.detail_value) >= 10
            AND SUBSTRING(permit_expiration_date.detail_value,
            5,
            1) = '-'
            AND SUBSTRING(permit_expiration_date.detail_value,
            8,
            1) = '-',
        STR_TO_DATE(LEFT(permit_expiration_date.detail_value,
                    10),
                '%Y-%m-%d'),
        NULL) AS permit_expiration_date,
    medical_id.detail_value AS medical_id,
    r.current_balance AS reward_balance,
    customer_source.detail_value AS customer_source,
    GROUP_CONCAT(DISTINCT cg.name) AS groupnames,
    COUNT(DISTINCT oc.id) AS visits,
    notes.detail_value AS notes,
    IFNULL(IF(opted_in.detail_value = 1, 'Y', 'N'),
            'N') AS opted_in,
    IF(patient_type.detail_value = 0,
        'ADULTUSE',
        IF(patient_type.detail_value = 1,
            'MEDICAL',
            '')) AS patient_type,
    IF(c.signup_flag >= 0,
        'ACTIVE',
        'DEACTIVATED') AS customer_status,
    violations.detail_value AS violations,
    ROUND(SUM(tl.priceSell * tl.amount) * COUNT(DISTINCT tl.id) / COUNT(*),
            2) AS netSales,
    ROUND(SUM(tl.priceSell * tl.amount) * COUNT(DISTINCT tl.id) / COUNT(*) / COUNT(DISTINCT tl.ticket_ticketline),
            2) AS AvgSales,
    ad.street_1,
    ad.city,
    us.abbreviation AS state,
    ad.zipcode,
    ad.longitude,
    ad.latitude,
    ph.first_name AS physician_first,
    ph.last_name AS physician_last,
    ph.phone AS physician_phone,
    MAX(CASE
        WHEN
            pd.detail_category = 'ADDRESS'
                AND pd.detail_name = 'FULL_ADDRESS'
        THEN
            pd.detail_value
    END) AS physician_address,
    ph.license AS physician_medical_id,
    ph.email AS physician_email,
    NULL AS physician_notes,
    caregiver.detail_value AS caregiver,
    NOW() AS report_last_updated
FROM
    dispensary.crm_customer c
        LEFT JOIN
    dispensary.posper_ticketline tl ON c.id = tl.hints_customer_id
        LEFT JOIN
    dispensary.crm_reward r ON r.customer_id = c.id
        LEFT JOIN
    dispensary.crm_customer_detail nick_name ON nick_name.customer_id = c.id
        AND nick_name.restaurant_id = 1
        AND nick_name.detail_category = 'INFO'
        AND nick_name.detail_name = 'NICKNAME'
        LEFT JOIN
    dispensary.crm_customer_detail gender ON gender.customer_id = c.id
        AND gender.restaurant_id = 1
        AND gender.detail_category = 'LICENSE'
        AND gender.detail_name = 'SEX'
        LEFT JOIN
    dispensary.crm_customer_detail drivers_license ON drivers_license.customer_id = c.id
        AND drivers_license.restaurant_id = 1
        AND drivers_license.detail_category = 'LICENSE'
        AND drivers_license.detail_name = 'ID'
        LEFT JOIN
    dispensary.crm_customer_detail drivers_license_expiration_date ON drivers_license_expiration_date.customer_id = c.id
        AND drivers_license_expiration_date.restaurant_id = 1
        AND drivers_license_expiration_date.detail_category = 'LICENSE'
        AND drivers_license_expiration_date.detail_name = 'EXPIRATION'
        LEFT JOIN
    dispensary.crm_customer_detail permit_expiration_date ON permit_expiration_date.customer_id = c.id
        AND permit_expiration_date.restaurant_id = 1
        AND permit_expiration_date.detail_category = 'INFO'
        AND permit_expiration_date.detail_name = 'EXPIRATION'
        LEFT JOIN
    dispensary.crm_customer_detail medical_id ON medical_id.customer_id = c.id
        AND medical_id.restaurant_id = 1
        AND medical_id.detail_category = 'INFO'
        AND medical_id.detail_name = 'MEDICAL_CARD'
        LEFT JOIN
    dispensary.crm_customer_detail customer_source ON customer_source.customer_id = c.id
        AND customer_source.restaurant_id = 1
        AND customer_source.detail_category = 'INFO'
        AND customer_source.detail_name = 'SOURCE'
        LEFT JOIN
    dispensary.crm_customer_detail opted_in ON opted_in.customer_id = c.id
        AND opted_in.restaurant_id = 1
        AND opted_in.detail_category = 'PROMOTION'
        AND opted_in.detail_name = 'OPTOUT'
        LEFT JOIN
    dispensary.crm_customer_detail patient_type ON patient_type.customer_id = c.id
        AND patient_type.restaurant_id = 1
        AND patient_type.detail_category = 'INFO'
        AND patient_type.detail_name = 'HAS_MED_CARD'
        LEFT JOIN
    dispensary.crm_customer_detail violations ON violations.customer_id = c.id
        AND violations.restaurant_id = 1
        AND violations.detail_category = 'INFO'
        AND violations.detail_name = 'VIOLATIONS'
        LEFT JOIN
    dispensary.crm_customer_detail caregiver ON caregiver.customer_id = c.id
        AND caregiver.restaurant_id = 1
        AND caregiver.detail_category = 'INFO'
        AND caregiver.detail_name = 'CAREGIVER_NAME'
        LEFT JOIN
    dispensary.crm_customer_detail last_visit ON last_visit.customer_id = c.id
        AND last_visit.restaurant_id = 1
        AND last_visit.detail_category = 'VISITS'
        AND last_visit.detail_name = 'LAST_VISIT'
        LEFT JOIN
    dispensary.crm_customer_detail dob ON dob.customer_id = c.id
        AND dob.restaurant_id = 1
        AND dob.detail_category = 'LICENSE'
        AND dob.detail_name = 'DOB'
        LEFT JOIN
    dispensary.crm_customer_detail notes ON notes.customer_id = c.id
        AND notes.restaurant_id = 1
        AND notes.detail_category = 'NOTES'
        AND notes.detail_name = 'IMPORT_NOTES'
        LEFT JOIN
    dispensary.crm_customer_detail phy ON phy.customer_id = c.id
        AND phy.restaurant_id = 1
        AND phy.detail_category = 'PHYSICIAN'
        AND phy.detail_name = 'ID'
        LEFT JOIN
    dispensary.crm_customer_customer_group ccg ON ccg.customer_id = c.id
        LEFT JOIN
    dispensary.crm_customer_group cg ON cg.id = ccg.group_id
        LEFT JOIN
    dispensary.crm_onsite_customer oc ON oc.customer_id = c.id
        LEFT JOIN
    dispensary.crm_address ad ON ad.customer_id = c.id AND ad.primary = 1
        LEFT JOIN
    dispensary.usa_states us ON us.id = ad.state
        LEFT JOIN
    dispensary.crm_physician ph ON phy.detail_value = ph.id
        LEFT JOIN
    dispensary.crm_physician_details pd ON pd.physician_id = ph.id
        AND pd.restaurant_id = 1
WHERE
    c.last_updated_at >= @start_dtm
        AND c.last_updated_at < @end_dtm
GROUP BY c.id
ON DUPLICATE KEY UPDATE
`id` = values(`id`),
`first_name` = values(`first_name`),
`last_name`= values(`last_name`),
`nick_name`= values(`nick_name`),
`phone`= values(`phone`),
`email`= values(`email`),
`company`= values(`company`),
`customer_uuid`= values(`customer_uuid`),
`customer_signup_date`= values(`customer_signup_date`),
`customer_cancel_date`= values(`customer_cancel_date`),
`last_updated_at`= values(`last_updated_at`),
`last_visit`= values(`last_visit`),
`signup_flag`= values(`signup_flag`),
`gender`= values(`gender`),
`age group`= values(`age group`),
`age`= values(`age`),
`dob`= values(`dob`),
`driver_license`= values(`driver_license`),
`driver_license_expiration_date`= values(`driver_license_expiration_date`),
`permit_expiration_date`= values(`permit_expiration_date`),
`medical_id`= values(`medical_id`),
`reward_balance`= values(`reward_balance`),
`customer_source`= values(`customer_source`),
`groupnames`= values(`groupnames`),
`visits`= values(`visits`),
`notes`= values(`notes`),
`opted_in`= values(`opted_in`),
`patient_type`= values(`patient_type`),
`customer_status`= values(`customer_status`),
`violations`= values(`violations`),
`netSales`= values(`netSales`),
`AvgSales`= values(`AvgSales`),
`street_1`= values(`street_1`),
`city`= values(`city`),
`state`= values(`state`),
`zipcode`= values(`zipcode`),
`longitude`= values(`longitude`),
`latitude`= values(`latitude`),
`physician_first`= values(`physician_first`),
`physician_last`= values(`physician_last`),
`physician_phone`= values(`physician_phone`),
`physician_address`= values(`physician_address`),
`physician_medical_id`= values(`physician_medical_id`),
`physician_email`= values(`physician_email`),
`physician_notes`= values(`physician_notes`),
`caregiver` = values(`caregiver`),
`report_last_updated` = values(`report_last_updated`);

   replace into custom_batch_job(report_name, last_run_dtm) values(rpt_name, @end_dtm);

   commit;
END ;;
