CREATE DEFINER=`root`@`localhost` PROCEDURE `report_discount_sp`(start_dtm_in datetime, end_dtm_in datetime, clear_period_in boolean)
proc:begin
   declare rpt_name varchar(25) default 'report_discount_sp';

   select ifnull(max(last_run_dtm), '1971-01-01') into @last_run
   from custom_batch_job
   where report_name = rpt_name;

   if start_dtm_in is null then
      set @start_dtm = @last_run;
   else
      set @start_dtm = start_dtm_in;
   end if;

   if end_dtm_in is null then
      set @end_dtm := now();
   else
      set @end_dtm = end_dtm_in;
   end if;

   start transaction;

if clear_period_in then
   delete from report_discount
       where discount_date >= @start_dtm
       and discount_date < @end_dtm;
end if;

INSERT INTO `inventory`.`report_discount`
(`discount_date`,
`dateOpen`,
`timeOpen`,
`dateClosed`,
`timeClose`,
`dateTimeClosed`,
`dateLastUpdate`,
`timeLastUpdate`,
`ticketAlphaId`,
`ticketlineId`,
`ticketId`,
`gender`,
`age`,
`dob`,
`customer_address`,
`customer_city`,
`customer_state`,
`customer_country`,
`customer_email`,
`customer_phone`,
`cashier`,
`cashierId`,
`productType`,
`productSubtype`,
`productBrand`,
`productName`,
`size`,
`brand`,
`pricePerUnit`,
`pricePerUnitAfterDiscount`,
`pricePerUnitDifference`,
`quantity`,
`netSales`,
`weight`,
`unitOfMeasure`,
`salesTax`,
`discountType`,
`discountMethod`,
`discountTitle`,
`discountReason`,
`discounts`,
`discountId`,
`discountLogId`,
`approver`,
`customerType`,
`customerName`,
`customerId`,
`customer_mmid`,
`customer_MMID_expiration`,
`document_id`,
`customerGroup`,
`stateTrackingId`,
`skus`,
`distributor`,
`receiving_license`,
`inventory_sku`,
`external_id`,
`total_mg_thc`,
`total_mg_cbd`,
`extraction_method`,
`inventory_type`,
`report_last_updated`)
SELECT
    ti.dateclose AS discount_date,
    DATE_FORMAT(ti.dateopen, '%m/%d/%Y') AS dateOpen,
    TIME(ti.dateopen) AS timeOpen,
    DATE_FORMAT(ti.dateclose, '%m/%d/%Y') AS dateClosed,
    TIME(ti.dateclose) AS timeClose,
    ti.dateclose AS dateTimeClosed,
    DATE_FORMAT(ti.last_update_at, '%m/%d/%Y') AS dateLastUpdate,
    TIME(ti.last_update_at) AS timeLastUpdate,
    ti.alpha_num_id AS ticketAlphaId,
    tl.id AS ticketlineId,
    ti.id AS ticketId,
    IF(ti.hints_customer_id IS NOT NULL
            AND (gender.detail_value IS NULL
            OR gender.detail_value = ''),
        'U',
        gender.detail_value) AS gender,
    IFNULL(TIMESTAMPDIFF(YEAR,
                IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                    STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                    NULL),
                ti.dateclose),
            'N/A') AS age,
    dob.detail_value AS dob,
    ti.hints_customer_address AS customer_address,
    ti.city AS customer_city,
    ti.state AS customer_state,
    ti.country AS customer_country,
    ti.email AS customer_email,
    ti.phone AS customer_phone,
    u.name AS cashier,
    u.id AS cashierId,
    type.name AS productType,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Subtype',
                    IF(product_detail.value = '',
                        'NO PRODUCT_SUBTYPE',
                        LEFT(product_detail.value, 255)),
                    NULL)),
            'NO PRODUCT_SUBTYPE') AS productSubtype,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Brand',
                    LEFT(product_detail.value, 255),
                    NULL)),
            'NO PRODUCT_BRAND') AS productBrand,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Name',
            LEFT(product_detail.value, 255),
            NULL)) AS productName,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Size',
            LEFT(product_detail.value, 255),
            NULL)) AS size,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Brand',
            LEFT(product_detail.value, 255),
            NULL)) AS brand,
    tl.priceSellOrig AS pricePerUnit,
    tl.priceSell AS pricePerUnitAfterDiscount,
    tl.priceSellOrig - tl.priceSell AS pricePerUnitDifference,
    tl.amount AS Quantity,
    tl.amount * tl.priceSell AS netSales,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Size',
            LEFT(product_detail.value, 255),
            NULL)) AS weight,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'UoM',
            LEFT(product_detail.value, 255),
            NULL)) AS unitOfMeasure,
    IFNULL(sales_tax.tax_charged, 0) AS salesTax,
    cd.discount_num_type AS discountType,
    cd.method AS discountMethod,
    CASE
        WHEN
            cd.method = 'percent'
        THEN
            IF(cd.amount IS NULL,
                cd.title,
                CONCAT(cd.title, ' % | ', cd.amount, '%'))
        WHEN
            cd.method = 'dollar'
        THEN
            IF(cd.amount IS NULL,
                cd.title,
                CONCAT(cd.title, ' $ | $', cd.amount))
    END AS discountTitle,
    IFNULL(applied_pos_discount.reason_value, 'N/A') AS discountReason,
    IF(tl.orig_ticket_line IS NOT NULL,
        cdl.savings * (tl.amount / otl.amount),
        cdl.savings) AS discounts,
    cd.id AS discountId,
    cdl.id AS discountLogId,
    verifier.name AS approver,
    ti.customer_type AS customerType,
    ti.hints_customer_name AS customerName,
    IFNULL(ti.hints_customer_id, 'N/A') AS customerId,
    ti.medical_id AS customer_mmid,
    ti.medical_id_expiration AS customer_MMID_expiration,
    ti.document_id AS document_id,
    ti.customer_groups AS customerGroup,
    package.package_label AS stateTrackingId,
    GROUP_CONCAT(DISTINCT barcode.code) AS skus,
    distributor.name AS distributor,
    package.dispensary_license AS receiving_license,
    GROUP_CONCAT(DISTINCT barcode_package.code) AS inventory_sku,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'External ID',
            LEFT(product_detail.value, 255),
            NULL)) AS external_id,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg THC',
            LEFT(product_detail.value, 255),
            NULL)) AS total_mg_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg CBD',
            LEFT(product_detail.value, 255),
            NULL)) AS total_cbd_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Extraction Method',
            LEFT(product_detail.value, 255),
            NULL)) AS extraction_method,
    tl.package_customer_type AS inventory_type,
    NOW() AS report_last_updated
FROM
    dispensary.posper_ticket ti
        JOIN
    dispensary.posper_ticketline tl ON tl.ticket_ticketline = ti.id
        JOIN
    dispensary.crm_discount_log cdl ON cdl.ticketline_id = CASE
        WHEN tl.orig_ticket_line IS NOT NULL THEN tl.orig_ticket_line
        ELSE tl.id
    END
        JOIN
    dispensary.crm_discount cd ON cdl.discount_id = cd.id
        LEFT JOIN
    dispensary.posper_ticketline otl ON otl.id = tl.orig_ticket_line
        LEFT JOIN
    inventory.tz_product product ON tl.product_id = product.id
        LEFT JOIN
    inventory.tz_product_detail product_detail ON product_detail.product_id = product.id
        LEFT JOIN
    inventory.tz_product_metadata product_metadata ON product_detail.product_metadata_id = product_metadata.id
        LEFT JOIN
    inventory.tz_type type ON product.type_id = type.id
        LEFT JOIN
    dispensary.crm_area_tax_ticketline_log sales_tax ON sales_tax.ticketline_id = tl.id
        AND sales_tax.area_tax_type = 'SALES'
        LEFT JOIN
    dispensary.crm_area_tax_ticketline_log city_tax ON city_tax.ticketline_id = tl.id
        AND city_tax.area_tax_type = 'CUSTOM'
        LEFT JOIN
    dispensary.crm_applied_pos_discount applied_pos_discount ON applied_pos_discount.id = cdl.application_id
        LEFT JOIN
    dispensary.crm_user verifier ON applied_pos_discount.verifier_id = verifier.id
        LEFT JOIN
    inventory.tz_invoice_line invoice_line ON invoice_line.product_id = product.id
        LEFT JOIN
    inventory.tz_package package ON package.invoice_line_id = invoice_line.id
        LEFT JOIN
    inventory.tz_invoice invoice ON invoice.id = invoice_line.invoice_id
        LEFT JOIN
    inventory.tz_distributor distributor ON package.distributor_id = distributor.id
        LEFT JOIN
    inventory.tz_invoice_line_cost line_cost ON invoice_line.cost_id = line_cost.id
        LEFT JOIN
    inventory.tz_barcode barcode ON product.id = barcode.reference_id
        AND barcode.reference_type = 'product'
        AND barcode.current_flag = 1
        LEFT JOIN
    dispensary.crm_user u ON (u.id = ti.userid)
        LEFT JOIN
    dispensary.crm_shift shift ON ((shift.id = ti.shift_id))
        LEFT JOIN
    dispensary.crm_account account ON ((account.id = shift.cash_drawer_id))
        LEFT JOIN
    dispensary.crm_customer_detail dob ON dob.customer_id = ti.hints_customer_id
        AND dob.detail_category = 'LICENSE'
        AND dob.detail_name = 'DOB'
        AND dob.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail gender ON gender.customer_id = ti.hints_customer_id
        AND gender.detail_category = 'LICENSE'
        AND gender.detail_name = 'SEX'
        AND gender.restaurant_id = 1
        LEFT JOIN
    inventory.tz_barcode barcode_package ON package.id = barcode_package.reference_id
        AND barcode_package.reference_type = 'package'
        AND barcode_package.source != 'PKG_LABEL'
        AND barcode_package.current_flag = 1
WHERE
    tl.updated_at >= DATE_SUB(@start_dtm, INTERVAL 35 SECOND)
        AND tl.updated_at < @end_dtm
        AND ti.dateclose IS NOT NULL
GROUP BY cdl.id , tl.id
UNION SELECT
    ti.dateclose AS discount_date,
    DATE_FORMAT(ti.dateopen, '%m/%d/%Y') AS dateOpen,
    TIME(ti.dateopen) AS timeOpen,
    DATE_FORMAT(ti.dateclose, '%m/%d/%Y') AS dateClosed,
    TIME(ti.dateclose) AS timeClose,
    ti.dateclose AS dateTimeClosed,
    DATE_FORMAT(ti.last_update_at, '%m/%d/%Y') AS dateLastUpdate,
    TIME(ti.last_update_at) AS timeLastUpdate,
    ti.alpha_num_id AS ticketAlphaId,
    tl.id AS ticketlineId,
    ti.id AS ticketId,
    IF(ti.hints_customer_id IS NOT NULL
            AND (gender.detail_value IS NULL
            OR gender.detail_value = ''),
        'U',
        gender.detail_value) AS gender,
    IFNULL(TIMESTAMPDIFF(YEAR,
                IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                    STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                    NULL),
                ti.dateclose),
            'N/A') AS age,
    dob.detail_value AS dob,
    ti.hints_customer_address AS customer_address,
    ti.city AS customer_city,
    ti.state AS customer_state,
    ti.country AS customer_country,
    ti.email AS customer_email,
    ti.phone AS customer_phone,
    u.name AS cashier,
    u.id AS cashierId,
    type.name AS productType,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Subtype',
                    IF(product_detail.value = '',
                        'NO PRODUCT_SUBTYPE',
                        LEFT(product_detail.value, 255)),
                    NULL)),
            'NO PRODUCT_SUBTYPE') AS productSubtype,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Brand',
                    LEFT(product_detail.value, 255),
                    NULL)),
            'NO PRODUCT_BRAND') AS productBrand,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Name',
            LEFT(product_detail.value, 255),
            NULL)) AS productName,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Size',
            LEFT(product_detail.value, 255),
            NULL)) AS size,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Brand',
            LEFT(product_detail.value, 255),
            NULL)) AS brand,
    tl.priceSellOrig AS pricePerUnit,
    tl.priceSell AS pricePerUnitAfterDiscount,
    tl.priceSellOrig - tl.priceSell AS pricePerUnitDifference,
    tl.amount AS Quantity,
    tl.amount * tl.priceSell AS netSales,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Size',
            LEFT(product_detail.value, 255),
            NULL)) AS weight,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'UoM',
            LEFT(product_detail.value, 255),
            NULL)) AS unitOfMeasure,
    IFNULL(sales_tax.tax_charged, 0) AS salesTax,
    cd.discount_num_type AS discountType,
    cd.method AS discountMethod,
    CASE
        WHEN
            cd.method = 'percent'
        THEN
            IF(cd.amount IS NULL,
                cd.title,
                CONCAT(cd.title, ' % | ', cd.amount, '%'))
        WHEN
            cd.method = 'dollar'
        THEN
            IF(cd.amount IS NULL,
                cd.title,
                CONCAT(cd.title, ' $ | $', cd.amount))
    END AS discountTitle,
    IFNULL(applied_pos_discount.reason_value, 'N/A') AS discountReason,
    IF(tl.orig_ticket_line IS NOT NULL,
        cdl.savings * (tl.amount / otl.amount),
        cdl.savings) AS discounts,
    cd.id AS discountId,
    cdl.id AS discountLogId,
    verifier.name AS approver,
    ti.customer_type AS customerType,
    ti.hints_customer_name AS customerName,
    IFNULL(ti.hints_customer_id, 'N/A') AS customerId,
    ti.medical_id AS customer_mmid,
    ti.medical_id_expiration AS customer_MMID_expiration,
    ti.document_id AS document_id,
    ti.customer_groups AS customerGroup,
    package.package_label AS stateTrackingId,
    GROUP_CONCAT(DISTINCT barcode.code) AS skus,
    distributor.name AS distributor,
    package.dispensary_license AS receiving_license,
    GROUP_CONCAT(DISTINCT barcode_package.code) AS inventory_sku,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'External ID',
            LEFT(product_detail.value, 255),
            NULL)) AS external_id,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg THC',
            LEFT(product_detail.value, 255),
            NULL)) AS total_mg_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg CBD',
            LEFT(product_detail.value, 255),
            NULL)) AS total_cbd_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Extraction Method',
            LEFT(product_detail.value, 255),
            NULL)) AS extraction_method,
    tl.package_customer_type AS inventory_type,
    NOW() AS report_last_updated
FROM
    dispensary.posper_ticket ti
        JOIN
    dispensary.posper_ticketline tl ON tl.ticket_ticketline = ti.id
        JOIN
    dispensary.crm_discount_log cdl ON cdl.ticketline_id = CASE
        WHEN tl.orig_ticket_line IS NOT NULL THEN tl.orig_ticket_line
        ELSE tl.id
    END
        JOIN
    dispensary.crm_discount cd ON cdl.discount_id = cd.id
        LEFT JOIN
    dispensary.posper_ticketline otl ON otl.id = tl.orig_ticket_line
        LEFT JOIN
    inventory.tz_product product ON tl.product_id = product.id
        LEFT JOIN
    inventory.tz_product_detail product_detail ON product_detail.product_id = product.id
        LEFT JOIN
    inventory.tz_product_metadata product_metadata ON product_detail.product_metadata_id = product_metadata.id
        LEFT JOIN
    inventory.tz_type type ON product.type_id = type.id
        LEFT JOIN
    dispensary.crm_area_tax_ticketline_log sales_tax ON sales_tax.ticketline_id = tl.id
        AND sales_tax.area_tax_type = 'SALES'
        LEFT JOIN
    dispensary.crm_area_tax_ticketline_log city_tax ON city_tax.ticketline_id = tl.id
        AND city_tax.area_tax_type = 'CUSTOM'
        LEFT JOIN
    dispensary.crm_applied_pos_discount applied_pos_discount ON applied_pos_discount.id = cdl.application_id
        LEFT JOIN
    dispensary.crm_user verifier ON applied_pos_discount.verifier_id = verifier.id
        LEFT JOIN
    inventory.tz_invoice_line invoice_line ON invoice_line.product_id = product.id
        LEFT JOIN
    inventory.tz_package package ON package.invoice_line_id = invoice_line.id
        LEFT JOIN
    inventory.tz_invoice invoice ON invoice.id = invoice_line.invoice_id
        LEFT JOIN
    inventory.tz_distributor distributor ON package.distributor_id = distributor.id
        LEFT JOIN
    inventory.tz_invoice_line_cost line_cost ON invoice_line.cost_id = line_cost.id
        LEFT JOIN
    inventory.tz_barcode barcode ON product.id = barcode.reference_id
        AND barcode.reference_type = 'product'
        AND barcode.current_flag = 1
        LEFT JOIN
    dispensary.crm_user u ON (u.id = ti.userid)
        LEFT JOIN
    dispensary.crm_shift shift ON ((shift.id = ti.shift_id))
        LEFT JOIN
    dispensary.crm_account account ON ((account.id = shift.cash_drawer_id))
        LEFT JOIN
    dispensary.crm_customer_detail dob ON dob.customer_id = ti.hints_customer_id
        AND dob.detail_category = 'LICENSE'
        AND dob.detail_name = 'DOB'
        AND dob.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail gender ON gender.customer_id = ti.hints_customer_id
        AND gender.detail_category = 'LICENSE'
        AND gender.detail_name = 'SEX'
        AND gender.restaurant_id = 1
        LEFT JOIN
    inventory.tz_barcode barcode_package ON package.id = barcode_package.reference_id
        AND barcode_package.reference_type = 'package'
        AND barcode_package.source != 'PKG_LABEL'
        AND barcode_package.current_flag = 1
WHERE
    tl.id IN (SELECT
            tl.id
        FROM
            dispensary.posper_ticket ti
                JOIN
            dispensary.posper_ticketline tl ON tl.ticket_ticketline = ti.id
                AND ti.dateclose IS NOT NULL
                AND tl.updated_at >= DATE_SUB(@start_dtm, INTERVAL 1 HOUR)
                AND tl.updated_at < DATE_SUB(@start_dtm, INTERVAL 5 MINUTE)
                JOIN
            dispensary.crm_discount_log cdl ON cdl.ticketline_id = tl.id
                AND cdl.id NOT IN (SELECT
                    discountLogId
                FROM
                    inventory.report_discount))
GROUP BY cdl.id , tl.id
ON DUPLICATE KEY UPDATE
`discount_date` = values(`discount_date`),
`dateOpen` = values(`dateOpen`),
`timeOpen` = values(`timeOpen`),
`dateClosed` = values(`dateClosed`),
`timeClose` = values(`timeClose`),
`dateTimeClosed` = values(`dateTimeClosed`),
`dateLastUpdate` = values(`dateLastUpdate`),
`timeLastUpdate` = values(`timeLastUpdate`),
`ticketAlphaId` = values(`ticketAlphaId`),
`ticketlineId` = values(`ticketlineId`),
`ticketId` = values(`ticketId`),
`gender` = values(`gender`),
`age` = values(`age`),
`dob` = values(`dob`),
`customer_address` = values(`customer_address`),
`customer_city` = values(`customer_city`),
`customer_state` = values(`customer_state`),
`customer_country` = values(`customer_country`),
`customer_email` = values(`customer_email`),
`customer_phone` = values(`customer_phone`),
`cashier` = values(`cashier`),
`cashierId` = values(`cashierId`),
`productType` = values(`productType`),
`productSubtype` = values(`productSubtype`),
`productBrand` = values(`productBrand`),
`productName` = values(`productName`),
`size` = values(`size`),
`brand` = values(`brand`),
`pricePerUnit` = values(`pricePerUnit`),
`pricePerUnitAfterDiscount` = values(`pricePerUnitAfterDiscount`),
`pricePerUnitDifference` = values(`pricePerUnitDifference`),
`quantity` = values(`quantity`),
`netSales` = values(`netSales`),
`weight` = values(`weight`),
`unitOfMeasure` = values(`unitOfMeasure`),
`salesTax` = values(`salesTax`),
`discountType` = values(`discountType`),
`discountMethod` = values(`discountMethod`),
`discountTitle` = values(`discountTitle`),
`discountReason` = values(`discountReason`),
`discounts` = values(`discounts`),
`discountId` = values(`discountId`),
`discountLogId` = values(`discountLogId`),
`approver` = values(`approver`),
`customerType` = values(`customerType`),
`customerName` = values(`customerName`),
`customerId` = values(`customerId`),
`customer_mmid` = values(`customer_mmid`),
`customer_MMID_expiration` = values(`customer_MMID_expiration`),
`document_id` = values(`document_id`),
`customerGroup` = values(`customerGroup`),
`stateTrackingId` = values(`stateTrackingId`),
`skus` = values(`skus`),
`distributor` = values(`distributor`),
`receiving_license` = values(`receiving_license`),
`inventory_sku` = values(`inventory_sku`),
`external_id` = values(`external_id`),
`total_mg_thc` = values(`total_mg_thc`),
`total_mg_cbd` = values(`total_mg_cbd`),
`extraction_method` = values(`extraction_method`),
`inventory_type` = values(`inventory_type`),
`report_last_updated` = values(`report_last_updated`);

   replace into custom_batch_job(report_name, last_run_dtm) values(rpt_name, @end_dtm);

   commit;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
ALTER DATABASE `inventory` CHARACTER SET utf8 COLLATE utf8_general_ci ;
/*!50003 DROP PROCEDURE IF EXISTS `report_payment_sp` */;
ALTER DATABASE `inventory` CHARACTER SET latin1 COLLATE latin1_swedish_ci ;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = latin1 */ ;
/*!50003 SET character_set_results = latin1 */ ;
/*!50003 SET collation_connection  = latin1_swedish_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ZERO_DATE,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `report_payment_sp`(start_dtm_in datetime, end_dtm_in datetime, clear_period_in boolean)
proc:begin
   declare rpt_name varchar(25) default 'report_payment_sp';

   select ifnull(max(last_run_dtm), '1971-01-01') into @last_run 
   from custom_batch_job 
   where report_name = rpt_name;
   
   if start_dtm_in is null then
      set @start_dtm = @last_run;
   else
      set @start_dtm = start_dtm_in;
   end if;

   if end_dtm_in is null then
      set @end_dtm := now();
   else
      set @end_dtm = end_dtm_in;
   end if;

   start transaction;

if clear_period_in then
   delete from report_payment
       where payment_date >= @start_dtm
       and payment_date < @end_dtm;
end if;

INSERT INTO `inventory`.`report_payment`
(`payment_date`,
`paymentid`,
`paymentName`,
`originalAmount`,
`changeAmount`,
`grossReceiptsPaid`,
`percent_of_ticket`,
`ticketId`,
`ticketAlphaNum`,
`dateClosed`,
`timeClosed`,
`paymentType`,
`customerType`,
`customerName`,
`customerId`,
`seconds_to_payment`,
`mmid`,
`customerGroups`,
`dateOpen`,
`timeOpened`,
`dateLastModified`,
`timeLastModified`,
`datePaymentProcessed`,
`timePaymentProcessed`,
`authCode`,
`refCode`,
`ticketLineId`,
`metrcReceipt`,
`activity`,
`cashier`,
`approver`,
`documentId`,
`age`,
`dob`,
`city`,
`stateProvince`,
`country`,
`primaryAddress`,
`zip`,
`gender`,
`email`,
`phone`,
`report_last_updated`)
SELECT
    ticket.dateclose AS payment_date,
    payment.id AS paymentid,
    payment_type.display_name AS paymentName,
    IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'ORIGINAL_PAYMENT' THEN pdet.detail_value
            END),
            payment.amount) AS originalAmount,
    IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'CHANGE_GIVEN' THEN pdet.detail_value
            END),
            0) AS changeAmount,
    IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'CHANGE_GIVEN' THEN - pdet.detail_value
            END),
            0) + IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'ORIGINAL_PAYMENT' THEN pdet.detail_value
            END),
            payment.amount) AS grossReceiptsPaid,
    NULL AS percent_of_ticket,
    ticket.id AS ticketId,
    ticket.alpha_num_id AS ticketAlphaNum,
    DATE(ticket.dateclose) AS dateClosed,
    TIME(ticket.dateclose) AS timeClosed,
    IF(payment.is_refund = '1',
        CONCAT(payment_type.display_name, ' Refund'),
        payment_type.display_name) AS paymentType,
    ticket.customer_type AS customerType,
    ticket.hints_customer_name AS customerName,
    IFNULL(ticket.hints_customer_id, '') AS customerId,
    TIMESTAMPDIFF(SECOND,
        ticket.dateopen,
        ticket.dateclose) AS seconds_to_payment,
    IFNULL(ticket.medical_id, 'N/A') AS mmid,
    IFNULL(ticket_groups.groupConcat, 'N/A') AS customerGroups,
    DATE(ticket.dateOpen) AS dateOpen,
    TIME(ticket.dateOpen) AS timeOpened,
    DATE(ticket.last_update_at) AS dateLastModified,
    TIME(ticket.last_update_at) AS timeLastModified,
    DATE(pdet.date_created) AS datePaymentProcessed,
    TIME(pdet.date_created) AS timePaymentProcessed,
    IF(pdet.detail_name = 'AUTHCODE',
        pdet.detail_value,
        'N/A') AS authCode,
    IF(pdet.detail_name = 'REFNO',
        pdet.detail_value,
        'N/A') AS refCode,
    '' AS ticketLineId,
    metrc.receipt_number AS metrcReceipt,
    ticket.ticket_type AS activity,
    user.name AS cashier,
    user.name AS approver,
    IFNULL(document_id_detail.detail_value, 'N/A') AS documentId,
    IF((TIMESTAMPDIFF(YEAR,
            dob_detail.dob,
            ticket.dateClose) <= 255)
            AND (TIMESTAMPDIFF(YEAR,
            dob_detail.dob,
            ticket.dateClose) >= 0)
            AND ticket.dateClose IS NOT NULL,
        TIMESTAMPDIFF(YEAR,
            dob_detail.dob,
            ticket.dateClose) + IF((TIMESTAMPDIFF(MONTH,
                dob_detail.dob,
                ticket.dateClose) - TIMESTAMPDIFF(YEAR,
                dob_detail.dob,
                ticket.dateClose) * 12) >= 6,
            1,
            0),
        NULL) AS age,
    dob_detail.dob AS dob,
    IFNULL(address.city, 'N/A') AS city,
    IFNULL(state.abbreviation, 'N/A') AS stateProvince,
    IF(address.country IS NULL,
        'N/A',
        'USA') AS country,
    CONCAT_WS(' ',
            address.street_1,
            address.street_2,
            address.city,
            state.abbreviation,
            address.zipcode) AS primaryAddress,
    address.zipcode AS zip,
    IF(customer.id IS NOT NULL
            AND (gender_detail.detail_value IS NULL
            OR gender_detail.detail_value = ''),
        'U',
        gender_detail.detail_value) AS gender,
    customer.email,
    customer.phone,
    NOW() AS report_last_updated
FROM
    dispensary.posper_ticket ticket
        JOIN
    dispensary.posper_payment payment ON ticket.id = payment.ticket_id
        LEFT JOIN
    dispensary.crm_payment_type payment_type ON payment_type.id = payment.payment_type_id
        LEFT JOIN
    dispensary.crm_payment_detail pdet ON pdet.payment_id = payment.id
        LEFT JOIN
    dispensary.crm_sale_tracking_receipt metrc ON metrc.ticket_id = ticket.id
        LEFT JOIN
    dispensary.crm_user user ON user.id = ticket.userid
        LEFT JOIN
    dispensary.crm_customer_detail document_id_detail ON ticket.hints_customer_id = document_id_detail.customer_id
        AND document_id_detail.detail_category = 'LICENSE'
        AND document_id_detail.detail_name = 'ID'
        AND document_id_detail.restaurant_id = 1
        LEFT JOIN
    (SELECT
        cd.customer_id,
            STR_TO_DATE(cd.detail_value, '%Y-%m-%d') AS dob
    FROM
        dispensary.crm_customer_detail cd
    WHERE
        cd.restaurant_id = 1
            AND cd.detail_name = 'DOB'
            AND cd.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$') AS dob_detail ON ticket.hints_customer_id = dob_detail.customer_id
        LEFT JOIN
    dispensary.crm_address address ON address.id = (SELECT
            ad.id
        FROM
            dispensary.crm_address ad
        WHERE
            ad.customer_id = ticket.hints_customer_id
                AND ad.primary = '1'
        LIMIT 1)
        LEFT JOIN
    dispensary.crm_customer_detail gender_detail ON ticket.hints_customer_id = gender_detail.customer_id
        AND gender_detail.detail_category = 'LICENSE'
        AND gender_detail.detail_name = 'SEX'
        AND gender_detail.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer customer ON ticket.hints_customer_id = customer.id
        LEFT JOIN
    dispensary.usa_states state ON address.state = state.id
        LEFT JOIN
    (SELECT
        ticket_group.id,
            GROUP_CONCAT(DISTINCT IFNULL(TRIM(customer_group.name), '')) AS groupConcat
    FROM
        dispensary.posper_ticket ticket_group
    JOIN dispensary.crm_customer customer ON ticket_group.hints_customer_id = customer.id
    JOIN dispensary.crm_customer_customer_group ccg ON ccg.customer_id = customer.id
    JOIN dispensary.crm_customer_group customer_group ON ccg.group_id = customer_group.id
    WHERE
        ticket_group.dateclose IS NOT NULL
            AND ticket_group.last_update_at >= DATE_SUB(@start_dtm, INTERVAL 35 SECOND)
            AND ticket_group.last_update_at < @end_dtm
    GROUP BY ticket_group.id) AS ticket_groups ON ticket.id = ticket_groups.id
WHERE
    (ticket.dateclose IS NOT NULL
        AND ticket.last_update_at >= DATE_SUB(@start_dtm, INTERVAL 35 SECOND)
        AND ticket.last_update_at < @end_dtm)
GROUP BY payment.id
UNION SELECT
    ticket.dateclose AS payment_date,
    payment.id AS paymentid,
    payment_type.display_name AS paymentName,
    IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'ORIGINAL_PAYMENT' THEN pdet.detail_value
            END),
            payment.amount) AS originalAmount,
    IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'CHANGE_GIVEN' THEN pdet.detail_value
            END),
            0) AS changeAmount,
    IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'CHANGE_GIVEN' THEN - pdet.detail_value
            END),
            0) + IFNULL(MAX(CASE
                WHEN pdet.detail_name = 'ORIGINAL_PAYMENT' THEN pdet.detail_value
            END),
            payment.amount) AS grossReceiptsPaid,
    NULL AS percent_of_ticket,
    ticket.id AS ticketId,
    ticket.alpha_num_id AS ticketAlphaNum,
    DATE(ticket.dateclose) AS dateClosed,
    TIME(ticket.dateclose) AS timeClosed,
    IF(payment.is_refund = '1',
        CONCAT(payment_type.display_name, ' Refund'),
        payment_type.display_name) AS paymentType,
    ticket.customer_type AS customerType,
    ticket.hints_customer_name AS customerName,
    IFNULL(ticket.hints_customer_id, '') AS customerId,
    TIMESTAMPDIFF(SECOND,
        ticket.dateopen,
        ticket.dateclose) AS seconds_to_payment,
    IFNULL(ticket.medical_id, 'N/A') AS mmid,
    IFNULL(ticket_groups.groupConcat, 'N/A') AS customerGroups,
    DATE(ticket.dateOpen) AS dateOpen,
    TIME(ticket.dateOpen) AS timeOpened,
    DATE(ticket.last_update_at) AS dateLastModified,
    TIME(ticket.last_update_at) AS timeLastModified,
    DATE(pdet.date_created) AS datePaymentProcessed,
    TIME(pdet.date_created) AS timePaymentProcessed,
    IF(pdet.detail_name = 'AUTHCODE',
        pdet.detail_value,
        'N/A') AS authCode,
    IF(pdet.detail_name = 'REFNO',
        pdet.detail_value,
        'N/A') AS refCode,
    '' AS ticketLineId,
    metrc.receipt_number AS metrcReceipt,
    ticket.ticket_type AS activity,
    user.name AS cashier,
    user.name AS approver,
    IFNULL(document_id_detail.detail_value, 'N/A') AS documentId,
    IF((TIMESTAMPDIFF(YEAR,
            dob_detail.dob,
            ticket.dateClose) <= 255)
            AND (TIMESTAMPDIFF(YEAR,
            dob_detail.dob,
            ticket.dateClose) >= 0)
            AND ticket.dateClose IS NOT NULL,
        TIMESTAMPDIFF(YEAR,
            dob_detail.dob,
            ticket.dateClose) + IF((TIMESTAMPDIFF(MONTH,
                dob_detail.dob,
                ticket.dateClose) - TIMESTAMPDIFF(YEAR,
                dob_detail.dob,
                ticket.dateClose) * 12) >= 6,
            1,
            0),
        NULL) AS age,
    dob_detail.dob AS dob,
    IFNULL(address.city, 'N/A') AS city,
    IFNULL(state.abbreviation, 'N/A') AS stateProvince,
    IF(address.country IS NULL,
        'N/A',
        'USA') AS country,
    CONCAT_WS(' ',
            address.street_1,
            address.street_2,
            address.city,
            state.abbreviation,
            address.zipcode) AS primaryAddress,
    address.zipcode AS zip,
    IF(customer.id IS NOT NULL
            AND (gender_detail.detail_value IS NULL
            OR gender_detail.detail_value = ''),
        'U',
        gender_detail.detail_value) AS gender,
    customer.email,
    customer.phone,
    NOW() AS report_last_updated
FROM
    dispensary.posper_ticket ticket
        JOIN
    dispensary.posper_payment payment ON ticket.id = payment.ticket_id
        LEFT JOIN
    dispensary.crm_payment_type payment_type ON payment_type.id = payment.payment_type_id
        LEFT JOIN
    dispensary.crm_payment_detail pdet ON pdet.payment_id = payment.id
        LEFT JOIN
    dispensary.crm_sale_tracking_receipt metrc ON metrc.ticket_id = ticket.id
        LEFT JOIN
    dispensary.crm_user user ON user.id = ticket.userid
        LEFT JOIN
    dispensary.crm_customer_detail document_id_detail ON ticket.hints_customer_id = document_id_detail.customer_id
        AND document_id_detail.detail_category = 'LICENSE'
        AND document_id_detail.detail_name = 'ID'
        AND document_id_detail.restaurant_id = 1
        LEFT JOIN
    (SELECT
        cd.customer_id,
            STR_TO_DATE(cd.detail_value, '%Y-%m-%d') AS dob
    FROM
        dispensary.crm_customer_detail cd
    WHERE
        cd.restaurant_id = 1
            AND cd.detail_name = 'DOB'
            AND cd.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$') AS dob_detail ON ticket.hints_customer_id = dob_detail.customer_id
        LEFT JOIN
    dispensary.crm_address address ON address.id = (SELECT
            ad.id
        FROM
            dispensary.crm_address ad
        WHERE
            ad.customer_id = ticket.hints_customer_id
                AND ad.primary = '1'
        LIMIT 1)
        LEFT JOIN
    dispensary.crm_customer_detail gender_detail ON ticket.hints_customer_id = gender_detail.customer_id
        AND gender_detail.detail_category = 'LICENSE'
        AND gender_detail.detail_name = 'SEX'
        AND gender_detail.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer customer ON ticket.hints_customer_id = customer.id
        LEFT JOIN
    dispensary.usa_states state ON address.state = state.id
        LEFT JOIN
    (SELECT
        ticket_group.id,
            GROUP_CONCAT(DISTINCT IFNULL(TRIM(customer_group.name), '')) AS groupConcat
    FROM
        dispensary.posper_ticket ticket_group
    JOIN dispensary.crm_customer customer ON ticket_group.hints_customer_id = customer.id
    JOIN dispensary.crm_customer_customer_group ccg ON ccg.customer_id = customer.id
    JOIN dispensary.crm_customer_group customer_group ON ccg.group_id = customer_group.id
    WHERE
        ticket_group.id IN (SELECT
                tl.id
            FROM
                dispensary.posper_ticket ti
            JOIN dispensary.posper_ticketline tl ON tl.ticket_ticketline = ti.id
                AND ti.dateclose IS NOT NULL
                AND tl.updated_at >= DATE_SUB(@start_dtm, INTERVAL 1 HOUR)
                AND tl.updated_at < DATE_SUB(@start_dtm, INTERVAL 5 MINUTE)
            JOIN dispensary.posper_payment pa ON pa.ticket_id = ti.id
                AND pa.id NOT IN (SELECT
                    paymentid
                FROM
                    inventory.report_payment))
    GROUP BY ticket_group.id) AS ticket_groups ON ticket.id = ticket_groups.id
WHERE
    payment.id IN (SELECT
            pa.id
        FROM
            dispensary.posper_ticket ti
                JOIN
            dispensary.posper_ticketline tl ON tl.ticket_ticketline = ti.id
                AND ti.dateclose IS NOT NULL
                AND tl.updated_at >= DATE_SUB(@start_dtm, INTERVAL 1 HOUR)
                AND tl.updated_at < DATE_SUB(@start_dtm, INTERVAL 5 MINUTE)
                JOIN
            dispensary.posper_payment pa ON pa.ticket_id = ti.id
                AND pa.id NOT IN (SELECT
                    paymentid
                FROM
                    inventory.report_payment))
GROUP BY payment.id
ON DUPLICATE KEY UPDATE
`payment_date` = values(`payment_date`),
`paymentid` = values(`paymentid`),
`paymentName` = values(`paymentName`),
`originalAmount` = values(`originalAmount`),
`changeAmount` = values(`changeAmount`),
`grossReceiptsPaid` = values(`grossReceiptsPaid`),
`percent_of_ticket` = values(`percent_of_ticket`),
`ticketId` = values(`ticketId`),
`ticketAlphaNum` = values(`ticketAlphaNum`),
`dateClosed` = values(`dateClosed`),
`timeClosed` = values(`timeClosed`),
`paymentType` = values(`paymentType`),
`customerType` = values(`customerType`),
`customerName` = values(`customerName`),
`customerId` = values(`customerId`),
`seconds_to_payment` = values(`seconds_to_payment`),
`mmid` = values(`mmid`),
`customerGroups` = values(`customerGroups`),
`dateOpen` = values(`dateOpen`),
`timeOpened` = values(`timeOpened`),
`dateLastModified` = values(`dateLastModified`),
`timeLastModified` = values(`timeLastModified`),
`datePaymentProcessed` = values(`datePaymentProcessed`),
`timePaymentProcessed` = values(`timePaymentProcessed`),
`authCode` = values(`authCode`),
`refCode` = values(`refCode`),
`ticketLineId` = values(`ticketLineId`),
`metrcReceipt` = values(`metrcReceipt`),
`activity` = values(`activity`),
`cashier` = values(`cashier`),
`approver` = values(`approver`),
`documentId` = values(`documentId`),
`age` = values(`age`),
`dob` = values(`dob`),
`city` = values(`city`),
`stateProvince` = values(`stateProvince`),
`country` = values(`country`),
`primaryAddress` = values(`primaryAddress`),
`zip` = values(`zip`),
`gender` = values(`gender`),
`email` = values(`email`),
`phone` = values(`phone`),
`report_last_updated` = values(`report_last_updated`);

   replace into custom_batch_job(report_name, last_run_dtm) values(rpt_name, @end_dtm);

   commit;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
ALTER DATABASE `inventory` CHARACTER SET utf8 COLLATE utf8_general_ci ;
/*!50003 DROP PROCEDURE IF EXISTS `report_product_sp` */;
ALTER DATABASE `inventory` CHARACTER SET latin1 COLLATE latin1_swedish_ci ;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = latin1 */ ;
/*!50003 SET character_set_results = latin1 */ ;
/*!50003 SET collation_connection  = latin1_swedish_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ZERO_DATE,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `report_product_sp`(IN start_dtm_in datetime, IN end_dtm_in datetime, IN clear_period_in tinyint(1))
proc:
  begin
    declare rpt_name varchar(25) default 'report_product_sp';

    select ifnull(max(last_run_dtm), '1971-01-01') into @last_run from custom_batch_job where report_name = rpt_name;

    if start_dtm_in is null
    then
      set @start_dtm = @last_run;
    else
      set @start_dtm = start_dtm_in;
    end if;

    if end_dtm_in is null
    then
      set @end_dtm := now();
    else
      set @end_dtm = end_dtm_in;
    end if;

    start transaction;

    if clear_period_in then
       delete from report_product
           where line_updated_date >= @start_dtm
           and line_updated_date < @end_dtm;
    end if;

    INSERT INTO `inventory`.`report_product` (`ticket_status`,
                                               `register`,
                                               `ticket_type`,
                                               `customer_type`,
                                               `type`,
                                               `customer`,
                                               `address`,
                                               `alternative_address`,
                                               `secondary_address`,
                                               `customer_country`,
                                               `customer_state`,
                                               `customer_city`,
                                               `zip_code`,
                                               `customer_groups`,
                                               `customer_MMID`,
                                               `customer_MMID_expiration`,
                                               `document_id`,
                                               `email`,
                                               `phone`,
                                               `gender`,
                                               `age`,
                                               `age group`,
                                               `dob`,
                                               `cashier`,
                                               `approver`,
                                               `productType`,
                                               `productSubtype`,
                                               `productAttributes`,
                                               `productBrand`,
                                               `productName`,
                                               `classification`,
                                               `tier`,
                                               `weight`,
                                               `unitOfMeasure`,
                                               `size`,
                                               `priceUnit`,
                                               `qty`,
                                               `grossSales`,
                                               `discounts`,
                                               `returns`,
                                               `netSales`,
                                               `taxes`,
                                               `grossReceipts`,
                                               `cost`,
                                               `cost_without_excise`,
                                               `grossIncome`,
                                               `avgProductMarginPreExcise`,
                                               `avgProductMargin`,
                                               `invoiceId`,
                                               `stateTrackingId`,
                                               `ticketId`,
                                               `ticketlineid`,
                                               `ticketAlphaId`,
                                               `customer_id`,
                                               `dateClosed`,
                                               `timeClosed`,
                                               `date_time_closed`,
                                               `date_time_opened`,
                                               `sku`,
                                               `customer_uuid`,
                                               `customer_signup_date`,
                                               `customer_cancel_date`,
                                               `reward_balance`,
                                               `inventory_location`,
                                               `ticket_updated_date`,
                                               `line_updated_date`,
                                               `ticket_notes`,
                                               `last_visit`,
                                               `customer_source`,
                                               `custom`,
                                               `customName`,
                                               `customTaxAmount`,
                                               `dynamic`,
                                               `dynamicTaxName`,
                                               `dynamicdTaxAmount`,
                                               `excise`,
                                               `exciseTaxName`,
                                               `ExciseTaxAmount`,
                                               `sales`,
                                               `salesTaxName`,
                                               `salesTaxAmount`,
                                               `is_arms_length`,
                                               `distributor`,
                                               `distributor_address`,
                                               `is_cannabis`,
                                               `receiving_license`,
                                               `batchId`,
                                               `inventory_sku`,
                                               `product_id`,
                                               `harvest_date`,
                                               `inventory_date`,
                                               `external_id`,
                                               `total_mg_thc`,
                                               `total_mg_cbd`,
                                               `extraction_method`,
                                               `caregiver_id`,
                                               `caregiver_name`,
                                               `inventory_type`,
                                               `ticket_created_user`,
                                               `ticketline_created_user`,
                                               `report_last_updated`)
SELECT
    ti.ticket_status,
    account.name AS register,
    ti.ticket_type,
    ti.customer_type,
    (CASE
        WHEN (tl.amount < 0) THEN 'Return'
        ELSE 'Sale'
    END) AS type,
    ti.hints_customer_name AS customer,
    ti.hints_customer_address AS address,
    (SELECT
            CONCAT_WS(', ',
                        a.street_1,
                        a.street_2,
                        a.city,
                        s.abbreviation,
                        a.zipcode) AS address
        FROM
            dispensary.crm_address a
                LEFT JOIN
            dispensary.usa_states s ON a.state = s.id
        WHERE
            `primary` = 0
                AND customer_id = ti.hints_customer_id
        LIMIT 1) AS alternative_address,
    (SELECT
            CONCAT_WS(', ',
                        a.street_1,
                        a.street_2,
                        a.city,
                        s.abbreviation,
                        a.zipcode) AS address
        FROM
            dispensary.crm_address a
                LEFT JOIN
            dispensary.usa_states s ON a.state = s.id
        WHERE
            `primary` = 0
                AND customer_id = ti.hints_customer_id
        LIMIT 1 OFFSET 1) AS secondary_address,
    ti.country AS customer_country,
    ti.state AS customer_state,
    ti.city AS customer_city,
    ti.zipcode AS zip_code,
    ti.customer_groups AS customer_groups,
    ti.medical_id AS customer_mmid,
    IF(CAST(ti.medical_id_expiration AS CHAR (20)) = '0000-00-00 00:00:00',
        NULL,
        ti.medical_id_expiration) AS customer_MMID_expiration,
    ti.document_id AS document_id,
    ti.email AS email,
    ti.phone AS phone,
    IF(c.id IS NOT NULL
            AND (gender.detail_value IS NULL
            OR gender.detail_value = ''),
        'U',
        IF(gender.detail_value = ''
                OR gender.detail_value IS NULL,
            'None',
            gender.detail_value)) AS gender,
    IFNULL(TIMESTAMPDIFF(YEAR,
                IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                    STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                    NULL),
                ti.dateclose),
            'N/A') AS age,
    (CASE
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') = 'None')
        THEN
            'None'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 60)
        THEN
            '60+'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 50)
        THEN
            '50-59'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 40)
        THEN
            '40-49'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 30)
        THEN
            '30-39'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 21)
        THEN
            '21-29'
        ELSE '0-20'
    END) AS `age group`,
    dob.detail_value AS dob,
    u.name AS cashier,
    u.name AS approver,
    type.name AS productType,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Subtype',
                    IF(product_detail.value = '',
                        'NO PRODUCT_SUBTYPE',
                        LEFT(product_detail.value, 255)),
                    NULL)),
            'NO PRODUCT_SUBTYPE') AS productSubtype,
    GROUP_CONCAT(DISTINCT product_attribute.name) AS productAttributes,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Brand',
                    LEFT(product_detail.value, 255),
                    NULL)),
            'NO PRODUCT_BRAND') AS productBrand,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Name',
            LEFT(product_detail.value, 255),
            NULL)) AS productName,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Classification',
                    LEFT(product_detail.value, 255),
                    NULL)),
            'N/A') AS classification,
    price_tier.label AS tier,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Amount',
            LEFT(product_detail.value, 255),
            NULL)) AS weight,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'UoM',
            LEFT(product_detail.value, 255),
            NULL)) AS unitOfMeasure,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Size',
            LEFT(product_detail.value, 255),
            NULL)) AS size,
    tl.priceSellOrig AS priceUnit,
    tl.amount AS qty,
    IF(tl.amount > 0,
        tl.priceSellOrig * tl.amount,
        0) AS grossSales,
    (tl.priceSellOrig - tl.priceSell) * tl.amount AS discounts,
    IF(tl.amount < 0,
        ABS(tl.priceSellOrig * tl.amount),
        0) AS returns,
    tl.priceSell * tl.amount AS netSales,
    IFNULL(SUM(ca.tax_charged) * COUNT(DISTINCT ca.id) / COUNT(*),
            0) AS taxes,
    (tl.priceSell * tl.amount) + IFNULL(SUM(ca.tax_charged) * COUNT(DISTINCT ca.id) / COUNT(*),
            0) AS grossReceipts,
    (inventory.cost_per_unit + inventory.excise_tax_per_unit) * tl.amount AS cost,
    (inventory.cost_per_unit) * tl.amount AS cost_without_excise,
    (tl.priceSell * tl.amount) - ((inventory.cost_per_unit + inventory.excise_tax_per_unit) * tl.amount) AS grossIncome,
    (((tl.priceSell * tl.amount) - ((inventory.cost_per_unit) * tl.amount)) / (tl.priceSellOrig * tl.amount)) * 100 AS avgProductMarginPreExcise,
    (((tl.priceSell * tl.amount) - ((inventory.cost_per_unit + inventory.excise_tax_per_unit) * tl.amount)) / (tl.priceSellOrig * tl.amount)) * 100 AS avgProductMargin,
    invoice.visible_id AS invoiceId,
    package.package_label AS stateTrackingId,
    ti.id AS ticketId,
    tl.id AS ticketlineid,
    ti.alpha_num_id AS ticketAlphaId,
    ti.hints_customer_id AS customer_id,
    DATE(ti.dateClose) AS dateClosed,
    TIME(ti.dateClose) AS timeClosed,
    ti.dateClose AS date_time_closed,
    ti.dateOpen AS date_time_opened,
    GROUP_CONCAT(DISTINCT barcode.code) AS sku,
    c.customer_uuid,
    c.signup_date customer_signup_date,
    c.cancel_date AS customer_cancel_date,
    r.current_balance AS reward_balance,
    location.name AS inventory_location,
    ti.last_update_at AS ticket_updated_date,
    CASE
        WHEN tl.updated_at IS NULL THEN tl.created_at
        ELSE tl.updated_at
    END AS line_updated_date,
    ctd.detail_value AS ticket_notes,
    last_visit.detail_value AS last_visit,
    source.detail_value AS customer_source,
    MAX((CASE
        WHEN (ca.area_tax_type = 'CUSTOM') THEN ca.area_tax_type
        ELSE NULL
    END)) AS custom,
    MAX((CASE
        WHEN (ca.area_tax_type = 'CUSTOM') THEN cat.name
        ELSE NULL
    END)) AS customName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'CUSTOM') THEN ca.tax_charged
        ELSE NULL
    END)) AS customTaxAmount,
    MAX((CASE
        WHEN (ca.area_tax_type = 'DYNAMIC') THEN ca.area_tax_type
        ELSE NULL
    END)) AS dynamic,
    MAX((CASE
        WHEN (ca.area_tax_type = 'DYNAMIC') THEN cat.name
        ELSE NULL
    END)) AS dynamicTaxName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'DYNAMIC') THEN ca.tax_charged
        ELSE NULL
    END)) AS dynamicdTaxAmount,
    MAX((CASE
        WHEN (ca.area_tax_type = 'EXCISE') THEN ca.area_tax_type
        ELSE NULL
    END)) AS excise,
    MAX((CASE
        WHEN (ca.area_tax_type = 'EXCISE') THEN cat.name
        ELSE NULL
    END)) AS exciseTaxName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'EXCISE') THEN ca.tax_charged
        ELSE NULL
    END)) AS ExciseTaxAmount,
    MAX((CASE
        WHEN (ca.area_tax_type = 'SALES') THEN ca.area_tax_type
        ELSE NULL
    END)) AS sales,
    MAX((CASE
        WHEN (ca.area_tax_type = 'SALES') THEN cat.name
        ELSE NULL
    END)) AS salesTaxName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'SALES') THEN ca.tax_charged
        ELSE NULL
    END)) AS salesTaxAmount,
    COALESCE(distributor.arms_length,
            IF(vd.detail_value = 'NON_ARMS_LENGTH',
                '0',
                '1')) AS is_arms_length,
    COALESCE(distributor.name, ve.company) AS distributor,
    distributor.address AS distributor_address,
    type.is_cannabis AS is_cannabis,
    package.dispensary_license AS receiving_license,
    COALESCE(inventory.batch_id, ut.visible_id) AS batchId,
    GROUP_CONCAT(DISTINCT barcode_package.code) AS inventory_sku,
    product.id AS product_id,
    package.harvest_date AS harvest_date,
    inventory.original_start_date AS inventory_date,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'External ID',
            LEFT(product_detail.value, 255),
            NULL)) AS external_id,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg THC',
            LEFT(product_detail.value, 255),
            NULL)) AS total_mg_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg CBD',
            LEFT(product_detail.value, 255),
            NULL)) AS total_cbd_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Extraction Method',
            LEFT(product_detail.value, 255),
            NULL)) AS extraction_method,
    ti.group_leader_license_id AS caregiver_id,
    CONCAT(group_leader.first_name,
            ' ',
            group_leader.last_name) AS caregiver_name,
    tl.package_customer_type AS inventory_type,
    ta_ticket_u.name AS ticket_created_user,
    ta_ticketline_u.name AS ticketline_created_user,
    NOW() AS report_last_updated
FROM
    dispensary.posper_ticketline tl
        JOIN
    dispensary.posper_ticket ti ON tl.ticket_ticketline = ti.id
        LEFT JOIN
    inventory.tz_product product ON tl.product_id = product.id
        LEFT JOIN
    inventory.tz_product_detail product_detail ON product_detail.product_id = product.id
        AND product_detail.current_flag = 1
        LEFT JOIN
    inventory.tz_product_metadata product_metadata ON product_detail.product_metadata_id = product_metadata.id
        AND product_metadata.current_flag = 1
        LEFT JOIN
    inventory.tz_type type ON product.type_id = type.id
        LEFT JOIN
    inventory.tz_inventory inventory ON tl.unit_id = inventory.id
        AND inventory.current_flag = 1
        LEFT JOIN
    inventory.tz_invoice_line invoice_line ON inventory.invoice_line_id = invoice_line.id
        AND invoice_line.current_flag = 1
        LEFT JOIN
    inventory.tz_invoice_line_cost line_cost ON invoice_line.cost_id = line_cost.id
        AND line_cost.current_flag = 1
        LEFT JOIN
    inventory.tz_invoice invoice ON invoice_line.invoice_id = invoice.id
        AND invoice.current_flag = 1
        LEFT JOIN
    inventory.tz_package package ON package.invoice_line_id = invoice_line.id
        AND package.current_flag = 1
        LEFT JOIN
    inventory.tz_barcode barcode ON product.id = barcode.reference_id
        AND barcode.reference_type = 'product'
        AND barcode.current_flag = 1
        LEFT JOIN
    inventory.tz_product_attribute product_attribute ON product.id = product_attribute.product_id
        AND product_attribute.current_flag = 1
        LEFT JOIN
    inventory.tz_product_tier product_tier ON product.id = product_tier.product_id
        AND product_tier.current_flag = 1
        LEFT JOIN
    inventory.tz_price_tier price_tier ON product_tier.tier_id = price_tier.id
        AND price_tier.current_flag = 1
        LEFT JOIN
    inventory.tz_distributor distributor ON package.distributor_id = distributor.id
        AND distributor.current_flag = 1
        LEFT JOIN
    dispensary.crm_user u ON (u.id = ti.userid)
        LEFT JOIN
    dispensary.crm_shift shift ON ((shift.id = ti.shift_id))
        LEFT JOIN
    dispensary.crm_account account ON ((account.id = shift.cash_drawer_id))
        LEFT JOIN
    dispensary.crm_customer c ON c.id = ti.hints_customer_id
        LEFT JOIN
    dispensary.crm_reward r ON r.customer_id = c.id
        LEFT JOIN
    inventory.tz_location location ON inventory.location_id = location.id
        AND location.current_flag = 1
        LEFT JOIN
    dispensary.crm_ticket_detail ctd ON ctd.ticket_id = ti.id
        AND ctd.detail_name = 'TICKET_NOTES'
        LEFT JOIN
    dispensary.crm_customer_detail dob ON dob.customer_id = ti.hints_customer_id
        AND dob.detail_category = 'LICENSE'
        AND dob.detail_name = 'DOB'
        AND dob.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail gender ON gender.customer_id = ti.hints_customer_id
        AND gender.detail_category = 'LICENSE'
        AND gender.detail_name = 'SEX'
        AND gender.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail last_visit ON last_visit.customer_id = ti.hints_customer_id
        AND last_visit.detail_category = 'VISITS'
        AND last_visit.detail_name = 'LAST_VISIT'
        AND last_visit.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail source ON source.customer_id = ti.hints_customer_id
        AND source.detail_category = 'INFO'
        AND source.detail_name = 'SOURCE'
        AND source.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_area_tax_ticketline_log ca ON ((tl.id = ca.ticketline_id))
        LEFT JOIN
    dispensary.crm_area_tax cat ON ((cat.id = ca.area_tax_id))
        LEFT JOIN
    dispensary.posper_ticketline tl_original ON tl.orig_ticket_line = tl_original.id
        LEFT JOIN
    inventory.tz_barcode barcode_package ON package.id = barcode_package.reference_id
        AND barcode_package.reference_type = 'package'
        AND barcode_package.source != 'PKG_LABEL'
        AND barcode_package.current_flag = 1
        LEFT JOIN
    dispensary.crm_inv_unit ut ON ut.id = tl.unit_id
        AND distributor.id IS NULL
        LEFT JOIN
    dispensary.crm_inv_shipment sm ON sm.id = ut.shipment_id
        LEFT JOIN
    dispensary.crm_inv_vendor ve ON ve.id = sm.vendor_id
        LEFT JOIN
    dispensary.crm_inv_vendor_detail vd ON vd.vendor_id = ve.id
        AND vd.detail_category = 'VENDOR_INFO'
        AND vd.detail_name = 'TYPE'
        LEFT JOIN
    dispensary.crm_customer group_leader ON group_leader.id = ti.group_leader_customer_id
        LEFT JOIN
    dispensary.crm_ticket_action ta_ticket ON ta_ticket.ticket_id = ti.id
        AND ta_ticket.action = 'CREATE'
        LEFT JOIN
    dispensary.crm_user ta_ticket_u ON ta_ticket_u.id = ta_ticket.user_id
        LEFT JOIN
    dispensary.crm_ticket_action ta_ticketline ON ta_ticketline.ticketline_id = tl.id
        AND ta_ticketline.action = 'ADD_TICKETLINE'
        LEFT JOIN
    dispensary.crm_user ta_ticketline_u ON ta_ticketline_u.id = ta_ticketline.user_id
WHERE
    tl.updated_at >= DATE_SUB(@start_dtm, INTERVAL 35 SECOND)
        AND tl.updated_at < @end_dtm
        AND ti.dateclose IS NOT NULL
GROUP BY tl.id
UNION SELECT
    ti.ticket_status,
    account.name AS register,
    ti.ticket_type,
    ti.customer_type,
    (CASE
        WHEN (tl.amount < 0) THEN 'Return'
        ELSE 'Sale'
    END) AS type,
    ti.hints_customer_name AS customer,
    ti.hints_customer_address AS address,
    (SELECT
            CONCAT_WS(', ',
                        a.street_1,
                        a.street_2,
                        a.city,
                        s.abbreviation,
                        a.zipcode) AS address
        FROM
            dispensary.crm_address a
                LEFT JOIN
            dispensary.usa_states s ON a.state = s.id
        WHERE
            `primary` = 0
                AND customer_id = ti.hints_customer_id
        LIMIT 1) AS alternative_address,
    (SELECT
            CONCAT_WS(', ',
                        a.street_1,
                        a.street_2,
                        a.city,
                        s.abbreviation,
                        a.zipcode) AS address
        FROM
            dispensary.crm_address a
                LEFT JOIN
            dispensary.usa_states s ON a.state = s.id
        WHERE
            `primary` = 0
                AND customer_id = ti.hints_customer_id
        LIMIT 1 OFFSET 1) AS secondary_address,
    ti.country AS customer_country,
    ti.state AS customer_state,
    ti.city AS customer_city,
    ti.zipcode AS zip_code,
    ti.customer_groups AS customer_groups,
    ti.medical_id AS customer_mmid,
    IF(CAST(ti.medical_id_expiration AS CHAR (20)) = '0000-00-00 00:00:00',
        NULL,
        ti.medical_id_expiration) AS customer_MMID_expiration,
    ti.document_id AS document_id,
    ti.email AS email,
    ti.phone AS phone,
    IF(c.id IS NOT NULL
            AND (gender.detail_value IS NULL
            OR gender.detail_value = ''),
        'U',
        IF(gender.detail_value = ''
                OR gender.detail_value IS NULL,
            'None',
            gender.detail_value)) AS gender,
    IFNULL(TIMESTAMPDIFF(YEAR,
                IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                    STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                    NULL),
                ti.dateclose),
            'N/A') AS age,
    (CASE
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') = 'None')
        THEN
            'None'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 60)
        THEN
            '60+'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 50)
        THEN
            '50-59'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 40)
        THEN
            '40-49'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 30)
        THEN
            '30-39'
        WHEN
            (IFNULL(TIMESTAMPDIFF(YEAR,
                        IF(dob.detail_value REGEXP '^s*([1-2]{1}[0-9]{3})-(0{1}[1-9]{1}|1{1}[0-2]{1})-(0{1}[1-9]{1}|[1-2]{1}[0-9]{1}|3{1}[0-1]{1})s*$',
                            STR_TO_DATE(dob.detail_value, '%Y-%m-%d'),
                            NULL),
                        CURDATE()),
                    'None') >= 21)
        THEN
            '21-29'
        ELSE '0-20'
    END) AS `age group`,
    dob.detail_value AS dob,
    u.name AS cashier,
    u.name AS approver,
    type.name AS productType,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Subtype',
                    IF(product_detail.value = '',
                        'NO PRODUCT_SUBTYPE',
                        LEFT(product_detail.value, 255)),
                    NULL)),
            'NO PRODUCT_SUBTYPE') AS productSubtype,
    GROUP_CONCAT(DISTINCT product_attribute.name) AS productAttributes,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Brand',
                    LEFT(product_detail.value, 255),
                    NULL)),
            'NO PRODUCT_BRAND') AS productBrand,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Name',
            LEFT(product_detail.value, 255),
            NULL)) AS productName,
    IFNULL(GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Classification',
                    LEFT(product_detail.value, 255),
                    NULL)),
            'N/A') AS classification,
    price_tier.label AS tier,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Amount',
            LEFT(product_detail.value, 255),
            NULL)) AS weight,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'UoM',
            LEFT(product_detail.value, 255),
            NULL)) AS unitOfMeasure,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Size',
            LEFT(product_detail.value, 255),
            NULL)) AS size,
    tl.priceSellOrig AS priceUnit,
    tl.amount AS qty,
    IF(tl.amount > 0,
        tl.priceSellOrig * tl.amount,
        0) AS grossSales,
    (tl.priceSellOrig - tl.priceSell) * tl.amount AS discounts,
    IF(tl.amount < 0,
        ABS(tl.priceSellOrig * tl.amount),
        0) AS returns,
    tl.priceSell * tl.amount AS netSales,
    IFNULL(SUM(ca.tax_charged) * COUNT(DISTINCT ca.id) / COUNT(*),
            0) AS taxes,
    (tl.priceSell * tl.amount) + IFNULL(SUM(ca.tax_charged) * COUNT(DISTINCT ca.id) / COUNT(*),
            0) AS grossReceipts,
    (inventory.cost_per_unit + inventory.excise_tax_per_unit) * tl.amount AS cost,
    (inventory.cost_per_unit) * tl.amount AS cost_without_excise,
    (tl.priceSell * tl.amount) - ((inventory.cost_per_unit + inventory.excise_tax_per_unit) * tl.amount) AS grossIncome,
    (((tl.priceSell * tl.amount) - ((inventory.cost_per_unit) * tl.amount)) / (tl.priceSellOrig * tl.amount)) * 100 AS avgProductMarginPreExcise,
    (((tl.priceSell * tl.amount) - ((inventory.cost_per_unit + inventory.excise_tax_per_unit) * tl.amount)) / (tl.priceSellOrig * tl.amount)) * 100 AS avgProductMargin,
    invoice.visible_id AS invoiceId,
    package.package_label AS stateTrackingId,
    ti.id AS ticketId,
    tl.id AS ticketlineid,
    ti.alpha_num_id AS ticketAlphaId,
    ti.hints_customer_id AS customer_id,
    DATE(ti.dateClose) AS dateClosed,
    TIME(ti.dateClose) AS timeClosed,
    ti.dateClose AS date_time_closed,
    ti.dateOpen AS date_time_opened,
    GROUP_CONCAT(DISTINCT barcode.code) AS sku,
    c.customer_uuid,
    c.signup_date customer_signup_date,
    c.cancel_date AS customer_cancel_date,
    r.current_balance AS reward_balance,
    location.name AS inventory_location,
    ti.last_update_at AS ticket_updated_date,
    CASE
        WHEN tl.updated_at IS NULL THEN tl.created_at
        ELSE tl.updated_at
    END AS line_updated_date,
    ctd.detail_value AS ticket_notes,
    last_visit.detail_value AS last_visit,
    source.detail_value AS customer_source,
    MAX((CASE
        WHEN (ca.area_tax_type = 'CUSTOM') THEN ca.area_tax_type
        ELSE NULL
    END)) AS custom,
    MAX((CASE
        WHEN (ca.area_tax_type = 'CUSTOM') THEN cat.name
        ELSE NULL
    END)) AS customName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'CUSTOM') THEN ca.tax_charged
        ELSE NULL
    END)) AS customTaxAmount,
    MAX((CASE
        WHEN (ca.area_tax_type = 'DYNAMIC') THEN ca.area_tax_type
        ELSE NULL
    END)) AS dynamic,
    MAX((CASE
        WHEN (ca.area_tax_type = 'DYNAMIC') THEN cat.name
        ELSE NULL
    END)) AS dynamicTaxName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'DYNAMIC') THEN ca.tax_charged
        ELSE NULL
    END)) AS dynamicdTaxAmount,
    MAX((CASE
        WHEN (ca.area_tax_type = 'EXCISE') THEN ca.area_tax_type
        ELSE NULL
    END)) AS excise,
    MAX((CASE
        WHEN (ca.area_tax_type = 'EXCISE') THEN cat.name
        ELSE NULL
    END)) AS exciseTaxName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'EXCISE') THEN ca.tax_charged
        ELSE NULL
    END)) AS ExciseTaxAmount,
    MAX((CASE
        WHEN (ca.area_tax_type = 'SALES') THEN ca.area_tax_type
        ELSE NULL
    END)) AS sales,
    MAX((CASE
        WHEN (ca.area_tax_type = 'SALES') THEN cat.name
        ELSE NULL
    END)) AS salesTaxName,
    MAX((CASE
        WHEN (ca.area_tax_type = 'SALES') THEN ca.tax_charged
        ELSE NULL
    END)) AS salesTaxAmount,
    COALESCE(distributor.arms_length,
            IF(vd.detail_value = 'NON_ARMS_LENGTH',
                '0',
                '1')) AS is_arms_length,
    COALESCE(distributor.name, ve.company) AS distributor,
    distributor.address AS distributor_address,
    type.is_cannabis AS is_cannabis,
    package.dispensary_license AS receiving_license,
    COALESCE(inventory.batch_id, ut.visible_id) AS batchId,
    GROUP_CONCAT(DISTINCT barcode_package.code) AS inventory_sku,
    product.id AS product_id,
    package.harvest_date AS harvest_date,
    inventory.original_start_date AS inventory_date,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'External ID',
            LEFT(product_detail.value, 255),
            NULL)) AS external_id,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg THC',
            LEFT(product_detail.value, 255),
            NULL)) AS total_mg_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Total Mg CBD',
            LEFT(product_detail.value, 255),
            NULL)) AS total_cbd_thc,
    GROUP_CONCAT(DISTINCT IF(product_metadata.field_name = 'Extraction Method',
            LEFT(product_detail.value, 255),
            NULL)) AS extraction_method,
    ti.group_leader_license_id AS caregiver_id,
    CONCAT(group_leader.first_name,
            ' ',
            group_leader.last_name) AS caregiver_name,
    tl.package_customer_type AS inventory_type,
    ta_ticket_u.name AS ticket_created_user,
    ta_ticketline_u.name AS ticketline_created_user,
    NOW() AS report_last_updated
FROM
    dispensary.posper_ticketline tl
        JOIN
    dispensary.posper_ticket ti ON tl.ticket_ticketline = ti.id
        LEFT JOIN
    inventory.tz_product product ON tl.product_id = product.id
        LEFT JOIN
    inventory.tz_product_detail product_detail ON product_detail.product_id = product.id
        AND product_detail.current_flag = 1
        LEFT JOIN
    inventory.tz_product_metadata product_metadata ON product_detail.product_metadata_id = product_metadata.id
        AND product_metadata.current_flag = 1
        LEFT JOIN
    inventory.tz_type type ON product.type_id = type.id
        LEFT JOIN
    inventory.tz_inventory inventory ON tl.unit_id = inventory.id
        AND inventory.current_flag = 1
        LEFT JOIN
    inventory.tz_invoice_line invoice_line ON inventory.invoice_line_id = invoice_line.id
        AND invoice_line.current_flag = 1
        LEFT JOIN
    inventory.tz_invoice_line_cost line_cost ON invoice_line.cost_id = line_cost.id
        AND line_cost.current_flag = 1
        LEFT JOIN
    inventory.tz_invoice invoice ON invoice_line.invoice_id = invoice.id
        AND invoice.current_flag = 1
        LEFT JOIN
    inventory.tz_package package ON package.invoice_line_id = invoice_line.id
        AND package.current_flag = 1
        LEFT JOIN
    inventory.tz_barcode barcode ON product.id = barcode.reference_id
        AND barcode.reference_type = 'product'
        AND barcode.current_flag = 1
        LEFT JOIN
    inventory.tz_product_attribute product_attribute ON product.id = product_attribute.product_id
        AND product_attribute.current_flag = 1
        LEFT JOIN
    inventory.tz_product_tier product_tier ON product.id = product_tier.product_id
        AND product_tier.current_flag = 1
        LEFT JOIN
    inventory.tz_price_tier price_tier ON product_tier.tier_id = price_tier.id
        AND price_tier.current_flag = 1
        LEFT JOIN
    inventory.tz_distributor distributor ON package.distributor_id = distributor.id
        AND distributor.current_flag = 1
        LEFT JOIN
    dispensary.crm_user u ON (u.id = ti.userid)
        LEFT JOIN
    dispensary.crm_shift shift ON ((shift.id = ti.shift_id))
        LEFT JOIN
    dispensary.crm_account account ON ((account.id = shift.cash_drawer_id))
        LEFT JOIN
    dispensary.crm_customer c ON c.id = ti.hints_customer_id
        LEFT JOIN
    dispensary.crm_reward r ON r.customer_id = c.id
        LEFT JOIN
    inventory.tz_location location ON inventory.location_id = location.id
        AND location.current_flag = 1
        LEFT JOIN
    dispensary.crm_ticket_detail ctd ON ctd.ticket_id = ti.id
        AND ctd.detail_name = 'TICKET_NOTES'
        LEFT JOIN
    dispensary.crm_customer_detail dob ON dob.customer_id = ti.hints_customer_id
        AND dob.detail_category = 'LICENSE'
        AND dob.detail_name = 'DOB'
        AND dob.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail gender ON gender.customer_id = ti.hints_customer_id
        AND gender.detail_category = 'LICENSE'
        AND gender.detail_name = 'SEX'
        AND gender.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail last_visit ON last_visit.customer_id = ti.hints_customer_id
        AND last_visit.detail_category = 'VISITS'
        AND last_visit.detail_name = 'LAST_VISIT'
        AND last_visit.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_customer_detail source ON source.customer_id = ti.hints_customer_id
        AND source.detail_category = 'INFO'
        AND source.detail_name = 'SOURCE'
        AND source.restaurant_id = 1
        LEFT JOIN
    dispensary.crm_area_tax_ticketline_log ca ON ((tl.id = ca.ticketline_id))
        LEFT JOIN
    dispensary.crm_area_tax cat ON ((cat.id = ca.area_tax_id))
        LEFT JOIN
    dispensary.posper_ticketline tl_original ON tl.orig_ticket_line = tl_original.id
        LEFT JOIN
    inventory.tz_barcode barcode_package ON package.id = barcode_package.reference_id
        AND barcode_package.reference_type = 'package'
        AND barcode_package.source != 'PKG_LABEL'
        AND barcode_package.current_flag = 1
        LEFT JOIN
    dispensary.crm_inv_unit ut ON ut.id = tl.unit_id
        AND distributor.id IS NULL
        LEFT JOIN
    dispensary.crm_inv_shipment sm ON sm.id = ut.shipment_id
        LEFT JOIN
    dispensary.crm_inv_vendor ve ON ve.id = sm.vendor_id
        LEFT JOIN
    dispensary.crm_inv_vendor_detail vd ON vd.vendor_id = ve.id
        AND vd.detail_category = 'VENDOR_INFO'
        AND vd.detail_name = 'TYPE'
        LEFT JOIN
    dispensary.crm_customer group_leader ON group_leader.id = ti.group_leader_customer_id
        LEFT JOIN
    dispensary.crm_ticket_action ta_ticket ON ta_ticket.ticket_id = ti.id
        AND ta_ticket.action = 'CREATE'
        LEFT JOIN
    dispensary.crm_user ta_ticket_u ON ta_ticket_u.id = ta_ticket.user_id
        LEFT JOIN
    dispensary.crm_ticket_action ta_ticketline ON ta_ticketline.ticketline_id = tl.id
        AND ta_ticketline.action = 'ADD_TICKETLINE'
        LEFT JOIN
    dispensary.crm_user ta_ticketline_u ON ta_ticketline_u.id = ta_ticketline.user_id
WHERE
    tl.id IN (SELECT
            tl.id
        FROM
            dispensary.posper_ticket ti
                JOIN
            dispensary.posper_ticketline tl ON tl.ticket_ticketline = ti.id
                AND tl.id NOT IN (SELECT
                    ticketlineid
                FROM
                    inventory.report_product)
                AND ti.dateclose IS NOT NULL
                AND tl.updated_at >= DATE_SUB(@start_dtm, INTERVAL 1 HOUR)
                AND tl.updated_at < DATE_SUB(@start_dtm, INTERVAL 5 MINUTE))
GROUP BY tl.id
    ON DUPLICATE KEY UPDATE
