CREATE DEFINER=`root`@`localhost` PROCEDURE `report_visitor_sp`(IN start_dtm_in datetime, IN end_dtm_in datetime, IN clear_period_in tinyint(1))
proc:
  begin
    declare rpt_name varchar(25) default 'report_visitor_sp';

    select ifnull(max(last_run_dtm), '1971-01-01') into @last_run from custom_batch_job where report_name = rpt_name;

    if start_dtm_in is null
    then
      set @start_dtm = @last_run;
    else
      set @start_dtm = start_dtm_in;
    end if;

    if end_dtm_in is null
    then
      set @end_dtm := now();
    else
      set @end_dtm = end_dtm_in;
    end if;

    start transaction;

    if clear_period_in then
       delete from report_visitor
           where last_updated_at >= @start_dtm
           and last_updated_at < @end_dtm;
    end if;

INSERT INTO `inventory`.`report_visitor`
(`visit_id`,
`customer_id`,
`visit_time`,
`first_name`,
`last_name`,
`phone`,
`email`,
`city`,
`state`,
`zipcode`,
`longitude`,
`latitude`,
`report_last_updated`)
SELECT
    coc.id AS visit_id,
    coc.customer_id,
    coc.login_time AS visit_time,
    cc.first_name,
    cc.last_name,
    IFNULL(cc.phone, '') AS phone,
    IFNULL(cc.email, '') AS email,
    ca.city,
    us.abbreviation AS state,
    ca.zipcode,
    ca.longitude,
    ca.latitude,
    NOW() AS report_last_updated
FROM
    dispensary.crm_onsite_customer coc
        JOIN
    dispensary.crm_customer cc ON cc.id = coc.customer_id
        JOIN
    dispensary.crm_address ca ON ca.customer_id = coc.customer_id
        AND ca.primary = 1
        JOIN
    dispensary.usa_states us ON us.id = ca.state
WHERE
    coc.login_time >= @start_dtm
        AND coc.login_time < @end_dtm
ON DUPLICATE KEY UPDATE
`visit_id` = values(`visit_id`),
`customer_id` = values(`customer_id`),
`visit_time`= values(`visit_time`),
`first_name`= values(`first_name`),
`last_name`= values(`last_name`),
`phone`= values(`phone`),
`email`= values(`email`),
`city`= values(`city`),
`state`= values(`state`),
`zipcode`= values(`zipcode`),
`longitude`= values(`longitude`),
`latitude`= values(`latitude`),
`report_last_updated` = values(`report_last_updated`);

   replace into custom_batch_job(report_name, last_run_dtm) values(rpt_name, @end_dtm);

   commit;
END ;;
